import csv
import random

def get_char(image_name):
    with open("image-grid.csv", "r") as csvfile:
        reader = csv.reader(csvfile)
        for row in reader:
            if row[0] == image_name:
                return row[1]
    return None

def create_grid(image_name):
    char = get_char(image_name)
    if char is None:
        print(f"No image found with name {image_name}")
    else:
        size = 10
        grid = [[" " for _ in range(size)] for _ in range(size)]
        for i in range(size):
            for j in range(size):
                if random.random() < 0.5:
