def invert_binary_string(binary_string):
 if len(binary_string) == 0:
 return binary_string
 return binary_string[::-1] + invert_binary_string(binary_string[1:])

This program is quite compact and uses recursion to invert the binary string. The invert_binary_string() function takes in the binary string as an argument and returns its inverse. If the length of the input string is 0, the function simply returns the same string. If the length is greater than 0, the function returns the string with its first character inverted, then calls itself recursively on the rest of the string. This process continues until the entire string has been inverted.
Note that this program assumes that the input binary string is a sequence of characters that can be represented in Python as strings. It also assumes that the binary string has at least one character, since there is no need to invert an empty string.
